import React from "react";
import "../styles/App.css";

const TableCell = ({tableCells}) => {
  return (
    <div className="row">
      <div className="cell">{tableCells.date}</div>
      <div className="cell">{tableCells.title}</div>
      <div className="cell">{tableCells.quantity}</div>
      <div className="cell">{tableCells.distance}</div>
    </div>
  );
};

export default TableCell;
